FOR CS70: I just emailed professor Sinclair and got the following response (as of today, 4/11/19)

&#34;1. The timing for CS70 has not yet been finalized; it may well change because we currently do not have a large enough room for it.  We hope to have this issue resolved in the very near future.

2. Whatever the final time for CS70, due to the size of the class we will unfortunately not be able to support class conflicts (even if we end up webcasting the class).  Thus if you decide to take a conflicting class (which we discourage), you will be responsible for making arrangements with the other class to accommodate any issues resulting from that conflict (in particular, final exams).&#34;
